    <>
      <div className="mainBox">
        <img className="image" src="quote/18cce88e-a284-49b6-99cd-a3ae652f8ae1.jpg" alt="" />

        <img className="quote" src="quote/download.jpg" alt="" />
      </div>
    </>
  );
}

export default HomeSub4;
